import * as React from "react";
import Box from "@mui/material/Box";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";
import { Stack, TextField } from "@mui/material";
import { useState } from "react";

const Register = () => {
  const [user, setUser] = useState({
    name: "",
    password: "",
    confirmPassword: "",
  });
  const handleChange = (e) => {
    // const {userName,password,confirmPassword} =e.target.value
    setUser((prev) => {
      return {
        ...prev,
        [e.target.name]: [e.target.value],
      };
    });
  };
  return (

    <Card sx={{ minWidth: 275,backgroundColor:'GrayText' }} className="card">
      <CardContent sx={{display:'flex',flexDirection:"co"}}>
        <TextField
          id="outlined-basic"
          type="text"
          name="userName"
          value={user.name}
          onChange={handleChange}
          size="small"
          variant="outlined"
        />
        <TextField
          id="outlined-basic"
          type="password"
          name="password"
          value={user.password}
          onChange={handleChange}
          size="small"
          variant="outlined"
        />
        <TextField
          id="outlined-basic"
          type="password"
          name="confirmPassword"
          value={user.confirmPassword}
          onChange={handleChange}
          size="small"
          variant="outlined"
        />
      </CardContent>
      <CardActions>
        <Button size="small">Create User</Button>
      </CardActions>
      <Stack spacing={2}>
        <Typography>Already registered ?</Typography>
        <Typography>LogIn</Typography>
      </Stack>
    </Card>
  );
};

export default Register;
